import React from "react";

export default function BookItem(props) {
  return (
    <tr className="individual-book">
      <td>props.srNo</td>
      <td>prop.bookItem.name</td>
      <td>Author</td>
      <td>Genre</td>
      <td>Pirate Link</td>
    </tr>
  );
}
